import React, { useState } from 'react'
const Counter = () => {
    let [count, setCount] = useState(0)
    const handleClick =() =>{
        alert('클릭 이벤트 확인')
        setCount({
            count: count + 1
        })
    }
    return <>
        <h1>counter : {count} </h1>
        <button onClick={handleClick}>click me</button>   
    </>
}
export default Counter
